class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& b) {
        int m=b.size();
        int n=b[0].size();
        vector<vector<long long>> x(m, vector<long long>(3, -1000000000));
        vector<vector<int>> y(m, vector<int>(3));
        for (int i=0; i<m; i++) {
            for (int j=0; j<n; j++) {
                if (b[i][j]>x[i][0]) {
                    x[i][2]=x[i][1];
                    x[i][1]=x[i][0];
                    x[i][0]=b[i][j];
                    y[i][2]=y[i][1];
                    y[i][1]=y[i][0];
                    y[i][0]=j;
                } else if (b[i][j]>x[i][1]) {
                    x[i][2]=x[i][1];
                    x[i][1]=b[i][j];
                    y[i][2]=y[i][1];
                    y[i][1]=j;
                } else if (b[i][j]>x[i][2]) {
                    x[i][2]=b[i][j];
                    y[i][2]=j;
                }
            }
        }
        long long ret=-3000000000;
        for (int i=0; i<m; i++) {
            for (int j=i+1; j<m; j++) {
                for (int k=j+1; k<m; k++) {
                    for (int e=0; e<3; e++) {
                    for (int f=0; f<3; f++) {
                    for (int g=0; g<3; g++) {
                    if (y[i][e]!=y[j][f]&&y[i][e]!=y[k][g]&&y[j][f]!=y[k][g]) {
                        ret=max(ret, x[i][e]+x[j][f]+x[k][g]);
                    }

                    }

                    }

                    }
                }
            }
        }
        return ret;
    }
};
